var title_f39_31_40443="Classification of mast cell disorders";
var content_f39_31_40443=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F74166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F74166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of mast cell disorders",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Primary mast cell disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mastocytosis (systemic and cutaneous)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         Monoclonal mast cell activation syndrome",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Secondary mast cell disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allergic disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mast cell activation associated with chronic inflammatory or neoplastic disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical urticarias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic autoimmune urticaria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Idiopathic mast cell disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiopathic anaphylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiopathic urticaria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiopathic angioedema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         Mast cell activation syndrome",
"        </span>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Primary mast cell disorders are conditions in which clonal populations of mast cells arise from an affected progenitor. These cells&nbsp;demonstrate intrinsic defects in proliferation and activation pathways and abnormal genetic and surface markers.",
"    <br>",
"     Secondary mast cell disorders are conditions in which mast cells are normal in quantity and function and are responding to an external stimulus, such as an allergen, autoantibody, drug, or products of complement activation.",
"     <br>",
"      Idiopathic mast cell disorders are conditions in which there is no identifiable cause of mast cell activation.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f39_31_40443=[""].join("\n");
