var title_f39_31_40444="Growth hormone insensitivity syndromes";
var content_f39_31_40444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F62441&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F62441&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical and biochemical features of growth hormone insensitivity syndromes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Growth hormone",
"       </td>",
"       <td class=\"subtitle1\">",
"        GHBP",
"       </td>",
"       <td class=\"subtitle1\">",
"        IGF-I",
"       </td>",
"       <td class=\"subtitle1\">",
"        IGFBP-3",
"       </td>",
"       <td class=\"subtitle1\">",
"        ALS",
"       </td>",
"       <td class=\"subtitle1\">",
"        Treatment",
"       </td>",
"       <td class=\"subtitle1\">",
"        MIM",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Growth hormone receptor mutations (classic Laron syndrome)",
"       </td>",
"       <td>",
"        Postnatal growth failure, infantile facies, abnormal body composition. Mediterranean or Middle Eastern ancestry is common.",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        <p>",
"         &darr; (if mutation affects extracellular domain of the GH receptor)",
"        </p>",
"        <p>",
"         Otherwise N or &uarr;",
"        </p>",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        rIGF-I",
"       </td>",
"       <td>",
"        262500",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal growth hormone receptor signal transduction (STAT5b mutation)",
"       </td>",
"       <td>",
"        Postnatal growth failure, immune dysregulation",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        rIGF-I",
"       </td>",
"       <td>",
"        245590",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IGF-I gene mutation (partial loss of function)",
"       </td>",
"       <td>",
"        Marked prenatal growth failure; post-natal growth failure, neurocognitive defects, sensorineural hearing loss",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        rIGF-I",
"       </td>",
"       <td>",
"        608747",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Defective stabilization of circulating IGF-I (acid-labile subunit deficiency)",
"       </td>",
"       <td>",
"        Mild post-natal growth failure, usually delayed puberty",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;",
"       </td>",
"       <td>",
"        &darr;&darr;",
"       </td>",
"       <td>",
"        ? rIGF-I",
"       </td>",
"       <td>",
"        601489",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IGF-I receptor mutation (partial loss of function or tissue-specific defect)",
"       </td>",
"       <td>",
"        Pre- and post-natal growth failure, delayed bone maturation, variable phenotype",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        &uarr;&uarr;",
"       </td>",
"       <td>",
"        N or &uarr;",
"       </td>",
"       <td>",
"        N",
"       </td>",
"       <td>",
"        ?",
"       </td>",
"       <td>",
"        270450",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     GHBP: growth hormone binding protein; IGF-I: insulin-like growth factor I; IGFBP-3: insulin-like growth factor binding protein 3; ALS: acid-labile subunit; MIM: Mendelian Inheritance in Man database (National Institutes of Health); N: normal levels; rIGF-I: recombinant insulin-like growth factor I (mecasermin).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
